import * as React from "react";
import { withFormik, FormikProps, Form, FieldArray, Field, setNestedObjectValues } from "formik";

import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import IconButton from '@material-ui/core/IconButton';
import AddIcon from '@material-ui/icons/Add';
import RemoveIcon from '@material-ui/icons/Remove';
import { Process, ProcessProp, Activity, ProcessInstance } from "../backend/ts/common_define";
import { get_process_instance } from "../backend/ts/database";
import { Typography } from "@material-ui/core";
import Container from "react-bootstrap/Container";
import { render } from "react-dom";
import Timeline from '../components/Process_timeline';
import { useEffect } from "react";
import { RouteComponentProps } from "react-router";
import { typography } from "@material-ui/system";

interface View_Process_State {
    process?: ProcessInstance;
}
interface View_Process_Params {
    process_instance_name: string,
    user_name: string,
}

class View_Process extends React.Component {

    props: RouteComponentProps;
    state: View_Process_State;

    constructor(props: RouteComponentProps<View_Process_Params>) {
        super(props);
        this.props = props;
        console.log(props);
        this.state = {};
        get_process_instance(props.match.params.process_instance_name, props.match.params.user_name).then((value) => {
            console.log(value);
            this.setState({process:value});
        });

        /*  this.state = {
             process:
         } */
    }

    render() {
        if (this.state.process !== undefined){
            return (
                <div>
                    <Typography variant="h2" style={{ marginBottom: '0.3em' }}>
                        {this.state.process.title}
                    </Typography>
                    <Paper >
                        <Timeline activities={this.state.process.activities} />
                    </Paper>
                </div>
            );

        }else
            return (<Typography>Loading..</Typography>)
    }
};

export default View_Process;
